	STRING[2710]["ID"] = 2710
	STRING[2710]["KEY"] = "AREA_M1"
	STRING[2710]["VALUE"] = "繁华，热闹，太多词汇可以形容这里，这里已然成了人类的第二个地球，但他们显然不会忘记当年的战争，时刻准备着夺回当年他们丢失的东西…"
