STRING["index"][2711] = 2711
STRING[2711] = {}
	STRING[2711]["ID"] = 2711
	STRING[2711]["KEY"] = "AREA_M2"
	STRING[2711]["VALUE"] = "遥远的星空中，这里是人类帝国的前哨站，负责收集、监视着人工智能舰队的状况，这片区域处在一个随时可能触发危险的地带…"
