STRING["index"][2712] = 2712
STRING[2712] = {}
	STRING[2712]["ID"] = 2712
	STRING[2712]["KEY"] = "AREA_M3"
	STRING[2712]["VALUE"] = "在一望无际的星空中，漫天繁星，距离人类最近的一颗行星。原本平静的星球此刻却被人工智能盯住，试图要占领这片区域成为他们的殖民地…"
