STRING["index"][2713] = 2713
STRING[2713] = {}
	STRING[2713]["ID"] = 2713
	STRING[2713]["KEY"] = "AREA_M4"
	STRING[2713]["VALUE"] = "快速发展的人工智能，通过战争，占领了宇宙中一颗又一颗的行星，势要宇宙的控制权。而这里只是他们的众多殖民地中的一颗行星，但是依然十分危险…"
