	STRING[2714]["KEY"] = "AREA_M5"
	STRING[2714]["VALUE"] = "通过战争占领的行星，被人工智能发展成了实力强大的军事基地，行星上充满着各种舰队和补给站，是一颗难以攻破的行星…"
