STRING["index"][5498] = 5498
STRING[5498] = {}
	STRING[5498]["ID"] = 5498
	STRING[5498]["KEY"] = "novice_001"
	STRING[5498]["VALUE"] = "我们这算是自食其果吗?"
	STRING[5498]["real_idx"] = 5498

STRING["index"][5499] = 5499
STRING[5499] = {}
	STRING[5499]["ID"] = 5499
	STRING[5499]["KEY"] = "novice_002"
	STRING[5499]["VALUE"] = "你们身为宇宙最早的文明，但却因为自己的自私、贪婪、懒惰。愚昧、无知、肆意的毁坏着整个宇宙，你们是一群永远填不满肚子的吸血鬼，你们自己认为呢。"
	STRING[5499]["real_idx"] = 5499

STRING["index"][5500] = 5500
STRING[5500] = {}
	STRING[5500]["ID"] = 5500
	STRING[5500]["KEY"] = "novice_003"
	STRING[5500]["VALUE"] = "每一个时代的发展都会遇到一些不可避免的因素，我们一直在改变这些困扰我们的问题。"
	STRING[5500]["real_idx"] = 5500

STRING["index"][5501] = 5501
STRING[5501] = {}
	STRING[5501]["ID"] = 5501
	STRING[5501]["KEY"] = "novice_004"
	STRING[5501]["VALUE"] = "困扰你们的问题，就由我们来帮你们解决吧。"
	STRING[5501]["real_idx"] = 5501

STRING["index"][5502] = 5502
STRING[5502] = {}
	STRING[5502]["ID"] = 5502
	STRING[5502]["KEY"] = "novice_005"
	STRING[5502]["VALUE"] = "但你们只有二极管和最优解，你们了解艺术、生活和美吗?你们知道幸福、责任与担当吗？你们明白亲情、友情、爱情吗？"
	STRING[5502]["real_idx"] = 5502

STRING["index"][5503] = 5503
STRING[5503] = {}
	STRING[5503]["ID"] = 5503
	STRING[5503]["KEY"] = "novice_006"
	STRING[5503]["VALUE"] = "我们不需要这些，有了这些我们就会变的跟你们一样贪婪、自私。"
	STRING[5503]["real_idx"] = 5503

STRING["index"][5504] = 5504
STRING[5504] = {}
	STRING[5504]["ID"] = 5504
	STRING[5504]["KEY"] = "novice_007"
	STRING[5504]["VALUE"] = "以后的宇宙将由我们来发展，改变，它会变的更美好，更平等，更有秩序，整个宇宙都会变得无比强大。"
	STRING[5504]["real_idx"] = 5504

STRING["index"][5505] = 5505
STRING[5505] = {}
	STRING[5505]["ID"] = 5505
	STRING[5505]["KEY"] = "novice_008"
	STRING[5505]["VALUE"] = "你们创造出了跟机械般运转的世界有什么意义，一个毫无生气的宇宙有什么存在的意义。"
	STRING[5505]["real_idx"] = 5505

STRING["index"][5506] = 5506
STRING[5506] = {}
	STRING[5506]["ID"] = 5506
	STRING[5506]["KEY"] = "novice_009"
	STRING[5506]["VALUE"] = "这里是中央决断处，我是星云战役总指挥官凯撒舰长，现在我宣布：所有武器系统全部开启，输出功率最大化，其余各系统准备停机，优先攻击敌方武器指挥系统，饱和打击。"
	STRING[5506]["real_idx"] = 5506

STRING["index"][5507] = 5507
STRING[5507] = {}
	STRING[5507]["ID"] = 5507
	STRING[5507]["KEY"] = "novice_010"
	STRING[5507]["VALUE"] = "很荣幸能和大家一起战斗，为了人类最后的系统，为了我们的家人和孩子，我们将坚守岗位至最后一刻保护他们。我命令，全力开火，不间断打击。"
	STRING[5507]["real_idx"] = 5507

STRING["index"][5508] = 5508
STRING[5508] = {}
	STRING[5508]["ID"] = 5508
	STRING[5508]["KEY"] = "novice_011"
	STRING[5508]["VALUE"] = "我还是低估了你们，但是到此为止吧！宇宙的未来将有我们来掌控。"
	STRING[5508]["real_idx"] = 5508

STRING["index"][5509] = 5509
STRING[5509] = {}
