STRING["index"][5992] = 5992
STRING[5992] = {}
	STRING[5992]["ID"] = 5992
	STRING[5992]["KEY"] = "Arena_introduce"
	STRING[5992]["VALUE"] = "竞技场规则\n 1.玩家积分决定排名,每隔3天进行最终排名,系统自动发放排名奖励,之后积分重置;\n 2.每日可免费挑战10次（胜负都会扣挑战次数）,战败会进入挑战冷却时间;\n 3.将当前刷出的5个对手击败后可领取5杀奖励,每日只能领取一次;中途刷新则击杀数量置零;\n 4.挑战根据战斗结果和对决双方排名计算积分与荣耀点,被挑战者不获得积分与荣耀点;\n 5.荣耀点用于激活竞技场称号,荣耀点不会清除;\n 6.竞技场称号级别越高,加成的属性越高,需求的荣耀点也越多;"
	STRING[5992]["real_idx"] = 5992

STRING["index"][5993] = 5993
STRING[5993] = {}
	STRING[5993]["ID"] = 5993
	STRING[5993]["KEY"] = "Trial_introduce"
	STRING[5993]["VALUE"] = "试炼规则\n 1.每日可免费挑战1次,每个试炼星域拥有进入条件,共享挑战次数;\n 2.试炼进度永久保存,满星通关的不可再次挑战;\n 3.进入试炼前可选择出战飞船,进入后不可改变,在每一关战斗结束后,飞船的血量将保留至下一关,阵亡的飞船在下一关也不可继续使用。\n 4.试炼中可返回主城进行飞船培养等操作,返回试炼里,飞船属性将更新为最新的;\n 5.试炼中可使用重置功能立即结束本次试炼;\n 6.试炼关卡只拥有首杀奖励,但可累积通关星数领取星数宝箱;"
	STRING[5993]["real_idx"] = 5993

STRING["index"][5994] = 5994
STRING[5994] = {}
	STRING[5994]["ID"] = 5994
	STRING[5994]["KEY"] = "Planet_introduce"
	STRING[5994]["VALUE"] = "星系规则\n 1.资源采集----三种资源矿,等级越高,存储量越大,采集速度受玩家等级与主城等级的影响;采集完成后部队会带着采集的资源自动返回,附带邮件提醒。需布阵出征队伍,占用出征队列;部分矿占据怪物,需击败才能采集,不消耗体力值;\n 2.资源掠夺----当该资源矿已被其他玩家占领时,可以发起掠夺,战胜后可抢夺部分已采集的资源并自动占领资源矿继续采集余下的矿;需布阵出征队伍,占用出征队列,消耗体力;\n 3.打捞残骸----拥有打捞时间;残骸等级越高,奖励越丰厚;加入星盟后,会有额外的星盟礼包奖励;无需布阵出征队伍,但占用出征队列,消耗体力;\n 4.销毁行星带--行星带掉落各类道具,销毁时概率触发怪物战斗;需布阵出征队伍,占用出征队列,消耗体力;\n 5.突袭--------针对当前区域活动的玩家;战胜后可获得超额奖励;需布阵出征队伍,占用出征队列,消耗大量体力;"
	STRING[5994]["real_idx"] = 5994

